package cn.com.easyerp.core.cache;

public class TableViewStyle {
    private String id;
    private String name;
    private String style_html;

    public String getId() {
        return this.id;
    }

    public void setId(String id) {
        this.id = id;
    }

    public String getName() {
        return this.name;
    }

    public void setName(String name) {
        this.name = name;
    }

    public String getStyle_html() {
        return this.style_html;
    }

    public void setStyle_html(String style_html) {
        this.style_html = style_html;
    }
}
